package domain;

public class User {
	String yhdm;
	String thxm;
	String bmdm;
	String bmmc;
	public User() {
		// TODO Auto-generated constructor stub
	}
	public String getYhdm() {
		return yhdm;
	}
	public void setYhdm(String yhdm) {
		this.yhdm = yhdm;
	}
	public String getThxm() {
		return thxm;
	}
	public void setThxm(String thxm) {
		this.thxm = thxm;
	}
	public String getBmdm() {
		return bmdm;
	}
	public void setBmdm(String bmdm) {
		this.bmdm = bmdm;
	}
	public String getBmmc() {
		return bmmc;
	}
	public void setBmmc(String bmmc) {
		this.bmmc = bmmc;
	}
	
	
}
